import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Card, CardBody, CardTitle } from "reactstrap";
import './Login.css';

function Login() {
  return (
    <>
      <Card style={{  }}>
        <CardBody>
          <CardTitle className="loginTittle" tag="h3">Login</CardTitle>
        </CardBody>
      </Card>
    </>
  );
}
export default Login;
